import React, { Component } from 'react';
import Post from '../Post/Post';
import './Mainpage.css';
class Mainpage extends Component {
    constructor(props) {
        super(props);
        this.state={
            postList:[]
        }
    }

    componentDidMount()
    {
        this.getPost();
    }

        
    getPost=()=>{
        let data=[
            {
                "userName":"Rajat Narula",
                "postLike":"656757"
            }
        ];

        this.setState({postList:data});
    }

    render() { 
        return ( 
            <div>
                {
                    this.state.postList.map((item,index))
                }
                <Post userName="Rajat" imageLikes="5465467"/>
